# -*- coding=utf-8 -*-

import rcssmin

CSS_WIKI = 'ow-wiki'
CSS_ERROR = 'ow-error'
CSS_IMAGE = 'ow-image'
CSS_LINK_PAGE = 'ow-link-page'
CSS_LINK_ATTACH = 'ow-link-attach'
CSS_ATTACH_FILE = 'ow-attach-file'
CSS_ATTACH_IMAGE = 'ow-attach-image'
CSS_ATTACH_DIR = 'ow-attach-dir'
CSS_ATTACH_LIST = 'ow-attach-list'
CSS_ATTACH_LIST_ITEM = 'ow-attach-list-item'
CSS_ATTACH_ERROR = 'ow-attach-error'
CSS_CHILD_LIST = 'ow-child-list'
CSS_CHILD_LIST_TITLE = 'ow-child-list-title'
CSS_CHILD_LIST_ITEM = 'ow-child-list-item'
CSS_WIKI_INCLUDE = 'ow-wiki-include'
CSS_LIST_ITEM_EMPTY = 'ow-li-empty'
CSS_LIST_ITEM_TODO = 'ow-li-todo'
CSS_LIST_ITEM_INCOMPLETE = 'ow-li-incomplete'
CSS_LIST_ITEM_COMPLETE = 'ow-li-complete'
CSS_LIST_ITEM_STAR = 'ow-li-star'
CSS_LIST_ITEM_PLUS = 'ow-li-plus'
CSS_LIST_ITEM_MINUS = 'ow-li-minus'
CSS_LIST_ITEM_CIRCLE = 'ow-li-circle'
CSS_LIST_ITEM_CHECK = 'ow-li-check'
CSS_LIST_ITEM_LT = 'ow-li-lt'
CSS_LIST_ITEM_GT = 'ow-li-gt'


def getDefaultStyles() -> str:
    css = '''
		img {
            border:none;
            vertical-align:middle;
        }

        /* Error message */
        div.ow-error {
          color: #cc0033;
          background-color: #FFBABA;
          border: 1px solid;
		  margin: 1em 0px;
		  padding: 1em;
        }

        span.ow-error {
          color: #cc0033;
          background-color: #FFBABA;
          border: 1px solid;
		  margin: 1em 0px;
		  padding: 1em;
        }

        a.ow-link-page {
            text-decoration: none;
            border-bottom: 0.1em dashed;
        }

        /* Child list */
		ul.ow-child-list {
		  padding-left: 1rem;
          list-style-type: none;
		}

		ul.ow-child-list ul {
		  margin-left: 15px;
		  padding-left: 10px;
		  border-left: 1px dashed #ddd;
		}

        li.ow-child-list-item:before {
		  content: "";
		  padding-left: 1.5em;
          background-position: 0.0em 0.1em;
          background-size: auto 1.0em;
          background-repeat: no-repeat;
          height: 1.6em;
          background-image: url("data:image/svg+xml;base64,");
		}

        span.ow-child-list-title {
		  font-weight: bold;
        }

        span.ow-child-list-title:before {
		  margin-right: 0px;
		  content: "";
		  height: 1.8em;
		  vertical-align: middle;
		  width: 1.5em;
		  background-repeat: no-repeat;
		  display: inline-block;
		  background-image: url("data:image/svg+xml;base64,");
		  background-position: center center;
		  background-size: 75% auto;
		}

		/* Attachment link */
		a.ow-link-attach {
		  border-bottom: 1px solid transparent;
		  text-decoration: none;
		  font-style: italic;
          white-space: nowrap;
		}

		a.ow-link-attach:hover {
		  border-color: #eee;
		  color: #000;
		}

		a.ow-link-attach:before {
		  margin-right: 0px;
		  content: "";
		  height: 1.6em;
		  vertical-align: middle;
		  width: 1.5em;
		  background-repeat: no-repeat;
		  display: inline-block;
		  /* file icon by default */
		  background-image: url("data:image/svg+xml;base64,");
		  background-position: center center;
		  background-size: 75% auto;
		}

		a.ow-attach-dir:before {
		  margin-right: 2px;
		  content: "";
		  height: 1.8em;
		  vertical-align: middle;
		  width: 1.5em;
		  background-repeat: no-repeat;
		  display: inline-block;
		  /* folder icon if folder class is specified */
		  background-image: url("data:image/svg+xml;base64,");
		  background-position: center center;
		  background-size: 75% auto;
		}

		/* Attachments list - (:attachlist:) wiki command */
		ul.ow-attach-list {
		  margin-left: 0px;
		  padding-left: 0px;
		}

		.ow-attach-list ul {
		  margin-left: 15px;
		  padding-left: 10px;
		  border-left: 1px dashed #ddd;
		}

		ul.ow-attach-list li {
		  list-style: none;
		  font-weight: normal;
          background-image: none;
          padding-left: 1.0rem;
		}

		.ow-attach-list a.ow-attach-dir {
		  font-weight: bold;
		  font-style: normal;
		  transition: all 0.2s ease;
		}

        span.ow-attach-error {
		  font-style: italic;
          white-space: nowrap;
          color: #cc0033;
        }

        span.ow-attach-error:before {
		  margin-right: 0px;
		  content: "";
		  height: 1.8em;
		  vertical-align: middle;
		  width: 1.5em;
		  background-repeat: no-repeat;
		  display: inline-block;
		  background-image: url("data:image/svg+xml;base64,");
		  background-position: center center;
		  background-size: 75% auto;
		}
    '''

    return rcssmin.cssmin(css)
